import React from 'react'
import classes from '../styles/MealItem.module.css';
import { MealItemForm } from './MealItemForm';

export const MealItem = () => {
    const menu = [
        {
            name: 'fish',
            description: 'Something delicious oh yes',
            price: 19.90,
            id: 1
        },
        {
            name: 'Meat',
            description: 'Something delicious oh yes',
            price: 17.90,
            id: 2
        },
        {
            name: 'Chicken',
            description: 'Something delicious oh yes',
            price: 15.90,
            id: 3
        }
    ]

    return (
        <>
        {menu.map(dish => {
            return (
        <div className={classes.meal}>
            <div>
            <h3> {dish.name}</h3>
            <div className={classes.description}>Here goes the description</div>
            <div className={classes.price}>{`$${dish.name}`}</div>
            </div>
            <MealItemForm/>
            <div className={classes.meal}></div>
        </div>
        )})}
        </>
    )
}
